import React from 'react';
import './Home.scss';
import landingBG from '../../assets/images/landing-bg.png';

class Home extends React.Component {
  render() {
    return (
      <div>
        <div className="landing-title">
          <img src={landingBG} className="landing-background" alt="Capstone team" />
          <div className="project-name">MHCI  x numo</div>
          <div className="project-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore</div>
        </div>
        <div className="landing-problem">
          <div className="landing-problem-title">What's the problem?</div>
          <div className="landing-problem-desc">
            Card-linked offers(CLO) on debit cards were introduced by PNC. However, these offers did not gain traction amongst bank customers. Our team was asked to explore the CLO space to discover unmet needs of the customers and come up with better metrics to measure value of a CLO for banks, merchants and customers.
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
